import React from "react";
import { StyleSheet, Text, View } from "react-native";
import { connect } from "react-redux";
import { logoutUser } from "../../utilities/actions/auth";
import { ScrollView } from "react-native-gesture-handler";
import appValues from "../../constants/appValues";
import ProfileCard from "./components/ProfileCard";
import png from "../../assets/png";
// import { HeaderTitle } from "@react-navigation/stack";

function Profile(props) {
  return (
    <View style={{ flex: 1 }}>
      <ScrollView>
        <ProfileCard
          name="Muhamadu Buhari"
          src ={png.a}
          description="Lorem Ipsum is very architecty about so many other things happening in the world of houses and cats on the bridge downtown to the beach."
        />
      </ScrollView>
    </View>
  );
}

const styles = StyleSheet.create({});

const mapStateToProps = (state) => {
  const { auth } = state;
  return { auth };
};

const mapDispatchToProps = (dispatch) => {
  return {
    logoutUser: () => dispatch(logoutUser()),
  };
};

export default connect(mapStateToProps, mapDispatchToProps)(Profile);
